import React from "react"
import { Row, Col } from "react-bootstrap"
import Romeo1 from "../images/Romeo1.jpg"

const Testimonial = () => {
  return (
    <div>
      <Row>
        <Col
          lg={6}
          md={12}
          sm={12}
          style={{ background: "red" }}
          className='ml-auto mr-auto'
        >
          <Row>
            <Col>
              <div
                style={{
                  margin: "auto",
                  position: "relative",
                  width: "20vw",
                  height: "20vw",
                  background: "blue",
                  borderRadius: "50%",
                  overflow: "hidden"
                }}
              >
                <img
                  src={Romeo1}
                  style={{ maxWidth: "100%", opacity: ".2" }}
                ></img>
              </div>
            </Col>
          </Row>
        </Col>
      </Row>
    </div>
  )
}

export default Testimonial
